import React, { Component } from 'react';
import './App.css';

class App extends Component {
	constructor() {
		super();
		this.state = { anser: 'yes' };
	}
	render() {
		return (
			<div className="container">
				Do you love me ?
				<h1>{this.state.anser} </h1>
			</div>
		);
	}
}

export default App;
